import React, { Component } from "react";
import Navigation from "./Navigation";
export default class Services extends Component {
  render() {
    return (
      <div>
        <Navigation />
        <div className="content weights text-white">
          <h1 className="p-5">Services</h1>
          <div className="row">
            <div className="col-sm-12 col-md-6 col-lg-4">col 1</div>
            <div className="col-sm-12 col-md-6 col-lg-4">col 2</div>
            <div className="col-sm-12 col-md-6 col-lg-4">col 3</div>
          </div>
        </div>
      </div>
    );
  }
}
